import styled from 'styled-components';

export const DisplayContainer = styled.div`
  background: white;
  height: 90%;
  width: 35vw;
  border-radius: 6px;
  padding: 10px;
  color: grey;
  z-index: 2;

  p {
    color: black;
    font-size: 4vmin;
  }
`;
